import React from 'react';

function BookingList({ bookings }) {
  return (
    <div className="mt-6 bg-white shadow rounded-xl p-4">
      <h2 className="text-xl font-semibold text-indigo-700 mb-4">Your Bookings</h2>
      {bookings.length === 0 ? (
        <p className="text-gray-500 text-sm">No bookings found.</p>
      ) : (
        <ul className="space-y-3">
          {bookings.map(b => (
            <li key={b._id} className="bg-indigo-50 border border-indigo-200 rounded-md p-3">
              <p className="font-medium text-gray-800">
                {b.customer_name} ‚Äî <span className="text-sm text-gray-600">{b.service_id?.name}</span>
              </p>
              <p className="text-sm text-gray-600">üìç {b.address}</p>
              <p className="text-sm text-gray-600">üïí {new Date(b.date_time).toLocaleString()}</p>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default BookingList;
